import React, { Component } from 'react';
import ReactDOM from 'react-dom';
import {BrowserRouter, Route, Link} from 'react-router-dom';
import Shodo from './Worklist'
import Watchface from './Watchface'

class Works extends Component {
  constructor() {
    super();
    this.works = {
      categories: [
        {
          id: 1,
          name: "Shodo",
          imageUrl: "shodo"
        },
        {
          id: 2,
          name: "Watchface",
          imageUrl: "watchface"
        },
      ]
    };
  }

  render(){
    return(
      <div className="container mt-4">
        <h1>Works</h1>
        <div className="">
          <ul className="nav">
            <li className="nav-item"><Link className="nav-link" to={process.env.PUBLIC_URL + "/works/shodo"}>Shodo</Link></li>
            <li className="nav-item"><Link className="nav-link" to={process.env.PUBLIC_URL + "/works/watchface"}>Watchface</Link></li>
          </ul>

          <div className="row">
            <Link className="nav-link" to={process.env.PUBLIC_URL + "/works/shodo"}>
            <div className="col-lg-4 col-md-6 col-12 cover-img" Style="background-image:url('https://manablog.org/wp-content/uploads/2016/11/top-img.jpg');">
                <div className="about-text">
                    <h3>Shodo</h3>
                    <p>Bootstrap and Web design</p>
                </div>
            </div>
            </Link>
            <Link className="nav-link" to={process.env.PUBLIC_URL + "/works/watchface"}>
            <div className="col-lg-4 col-md-6 col-12 cover-img" Style="background-image:url('https://manablog.org/wp-content/uploads/2016/11/top-img.jpg');">
                <div className="about-text">
                    <h3>Watchface</h3>
                    <p>Available for jQuery and native</p>
                </div>
            </div>
            </Link>
          </div>     

        </div>
      </div>
    )
  }


}


export default Works;
